import React from 'react';


import { BrowserRouter as Router  , Route , Switch , Link } from 'react-router-dom';
import L from './components/login';


function App() {
  return (
  <Router>
    <Switch>
    <Link to = './components/login'>
      Click me
    </Link>
    </Switch>

    <Route path='./components/login'>

    <L/>
    </Route>






  </Router>
  );
}

export default App;
